import React from 'react';

const Experience = () => {
  return (
    <section className="experience" id="experience">
      <div className="glass-effect">
        <h2>My Experience</h2>
        <p>Details about your professional experience, projects, or achievements.</p>
      </div>
    </section>
  );
};

export default Experience;
